Ad Text:
PI.EXCHANGE is a deep-tech scale-up focused on the mission of democratizing data science and providing AI & predictive analytics services. Our business is centered around our three products: Demand Forecasting Studio, Customer Insights Studio and FlexiBuild Studio.

Our vision is to create a platform where people, even without formal training in data science like commercial managers, software engineers or business analysts can easily build, deploy and use machine learning predictions to solve real business problems, in minutes.¬†We aim to bring to our customers a simple and cost-efficient way to build smart applications and to supercharge their businesses with the power of Data Science and Machine Learning.¬†

At PI.EXCHANGE, we are building world-first technologies. We are constantly pushing boundaries and challenging the status quo, on a daily basis. As we are scaling up, we are looking for awesome teammates, from data scientists and software engineers to product designers and sales experts to join our team. If you are keen, we love to talk to you!

