THE ROLE

As a Product Data Scientist, you will help us take our products (with a heavy focus on our Demand Forecasting Studio) to the next level through your data science and programming expertise, and apply them to real-world business problems while building solutions for our enterprise clients using our suite of products. The role is a mix of development work focused on building algorithms and core data science modules of our products, plus client facing as and when the need arises. You will be working collaboratively within the Data Science team and across different teams in the company. Key responsibilities are:

Applying Data Science and Machine Learning to solve real-world business problems;

Developing new data-science / ML functions across products;

Taking charge of existing code base for continuous maintenance, bug fixing, and improvement;

Working with the Software/DevOps Engineering team to brainstorm ideas, develop new features and improve the product, delivering them as per the roadmap and release schedule;

Participate the design process for new features as a representative from the Data Science team, collaborating and sharing knowledge with product managers/analysts, software/DevOps engineers and UI/UX designers; and

Contribute to the evangelization of our product and culture internally and externally.

‚Äç

ABOUT YOU

Solid analytical thinking and problem-solving skills and can break a complex problem into smaller and solvable pieces;

Hands-on experience and demonstrable ability to code fluently in Python, complemented with the ability to quickly learn and code in other languages (such as Scala) on a smaller scale;

Strong working knowledge of efficient data structures, computational complexity and algorithms and the ability to apply them in practical situations;

Solid theoretical understanding in probability, statistics, supervised and unsupervised learning, time series and the ability to apply them to projects when needed;

Strong experience and demonstrable skills in Data Science stack covering scikit-learn, pandas, numpy, scipy. Desirable: Numba, dask, RAPIDS cuML and Apache Spark;

Experience in / be familiar with good software-engineering standards;

A big plus for real-world experience in working with customers to develop and deploy Data Science and ML¬†solutions for one or more of the following use cases: demand forecasting & planning, inventory planning, revenue optimization, price optimization, churn prediction & prevention in manufacturing, wholesale distribution, retail and/or logistics/supply chain; and

2+ years as a Data Scientist or ML Engineer in a strong data-driven SaaS environment/product;

